import React from "react";

import "./ServicesPage.css";
import yandexLogo from "../../images/Yandex_logo_Cyrillic.svg";
import ServicesItem from "../../components/ServicesItem/ServicesItem";

import img1 from "../../images/services-items/img1.svg";

const ServicesPage = () => {

    const services = [
        [logo, "Поиск", "Ответы на любые вопросы"],
        [logo, "Картинки", "Изображения всех цветов и размеров"],
        [logo, "Видео", "Просмотр фильмов, сериалов, телешоу, музыкальных роликов"],
        // [logo, "Погода", "Ответы на любые вопросы"],
        // [logo, "Карты", "Изображения всех цветов и размеров"],
        // [logo, "Почта", "Просмотр фильмов, сериалов, телешоу, музыкальных роликов"],
    ];

    return (
        <section id="services-page">
            <header>
                <img src={ yandexLogo } alt="" />
                <div id="services-links">
                    <a href="a">Сервисы</a>
                    <a href="a">Приложения</a>
                    <a href="a">Программы</a>
                    <a href="a">Для бизнеса</a>
                </div>
            </header>
            <div className="service-items-list">
                {services.map((list) => (
                     <ServicesItem key={list[1]} img={list[0]} header={list[1]} desc={list[2]} />
                ))}
            </div>
        </section>
    );
}

export default ServicesPage;
